import React from "react";
import "./ButtonSide.css";
import FacebookIcon from "@material-ui/icons/Facebook";
import YouTubeIcon from "@material-ui/icons/YouTube";
import CallIcon from "@material-ui/icons/Call";
import EmailIcon from "@material-ui/icons/Email";

class ButtonSide extends React.Component {
  render() {
    return (
      <div class="icon-bar">
        <a class="tooltip-ex twitter" href="#">
          <i class="fa fa-map-marker"></i>
          <span class="tooltip-ex-text tooltip-ex-right">
            Rouppeplein 16,
            <br /> 1000 Brussel
          </span>
        </a>

        <a class="tooltip-ex google" href="#">
          <i class="fa fa-envelope"></i>
          <span class="tooltip-ex-text tooltip-ex-right">
            info@intecbrussel.be
          </span>{" "}
          <EmailIcon />
        </a>

        <a class="tooltip-ex linkedin" href="#">
          <i class="fa fa-phone"></i>
          <span class="tooltip-ex-text tooltip-ex-right">
            02 411 29 07{" "}
          </span>{" "}
          <CallIcon />
        </a>

        <a
          class="tooltip-ex youtube"
          href="https://www.youtube.com/watch?v=hy6KtzDffu8"
        >
          <i class="fa fa-youtube"></i>
          <span class="tooltip-ex-text tooltip-ex-right">klik mij! </span>{" "}
          <YouTubeIcon />
        </a>

        <a
          class="tooltip-ex facebook"
          href="https://www.facebook.com/intecbrussel.be/"
        >
          <i class="fa fa-facebook"></i>
          <span class="tooltip-ex-text tooltip-ex-right">klik mij! </span>
          <div icon={["fab", "facebook-f"]} />
          <FacebookIcon />
        </a>
      </div>
    );
  }
}

export default ButtonSide;
